import React from "react";
import {Card} from 'semantic-ui-react'

function Forecast(){



    return(
        <div>
            <Card>
            <Card.Content>
                <Card.Header>Matthew Harris</Card.Header>
                <Card.Meta>Co-Worker</Card.Meta>
                <Card.Description>
                Matthew is a pianist living in Nashville.
                </Card.Description>
            </Card.Content>
            </Card>
        </div>
    )
}

export default Forecast;
